import BannerHomeComponent from "../../Component/BannerComponent/Banner";
import "./HomePage.css";
const HomePage = () => {
  return (
    <>
      <div className="home-wrapper">
        {/* banner */}
        <div className="banner-wrapper">
          <BannerHomeComponent />
        </div>
      </div>
    </>
  );
};

export default HomePage;
